value.client:
use kittycad::Client;
// Authenticate via an API token.
let client = Client::new("$TOKEN");
// - OR -
// Authenticate with your token and host parsed from the environment variables:
// KITTYCAD_API_TOKEN.
let client = Client::new_from_env();

value.example:
List API calls.

This endpoint requires authentication by a KittyCAD employee. The API calls are returned in order of creation, with the most recently created API calls first.
let result: crate::types::ApiCallWithPriceResultsPage = client.api_calls().list(self,limit:Option<u32>,page_token:Option<String>,sort_by:Option<crate::types::CreatedAtSortMode>).await?;

List users.

This endpoint required authentication by a KittyCAD employee. The users are returned in order of creation, with the most recently created users first.
let result: crate::types::UserResultsPage = client.users().list(self,limit:Option<u32>,page_token:Option<String>,sort_by:Option<crate::types::CreatedAtSortMode>).await?;

List users with extended information.

This endpoint required authentication by a KittyCAD employee. The users are returned in order of creation, with the most recently created users first.
let result: crate::types::ExtendedUserResultsPage = client.users().list_extended(self,limit:Option<u32>,page_token:Option<String>,sort_by:Option<crate::types::CreatedAtSortMode>).await?;
